export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "전세환",
      },
      content: "처 ㅅ 번째 게시글 #해시태그 #익스프래스,",
      Images: [{}]
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
